        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    Les rencontres internationales sont toujours des occasions de brassages culturelles dans toutes leurs diversités et qui parle de diversité culturelle
                    parle aussi d’une diversité de langues; d’où la nécessité d’avoir des professionnels de l’interprétation de conférences pour tirer pleinement profit
                    de l’inter culturalité.
                    La formation de Master professionnel Interprétation de conférence qui est proposée, s'inscrit dans ce contexte éminemment international.
                    A la fois intensive et progressiv");
            WriteLiteral(@"e, elle est rigoureusement encadrée par des interprètes professionnels engagés. Ce Master vise la pratique active
                    des différentes techniques d'interprétation dès la fin des études.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    Le Master professionnel Interpretation de conferences a pour objectif principal de nous permettre de nous adapter au contexte économique et
                    d’anticiper les changements à venir dans la profession (intégration plus progressive, exigence de mobilité accrue, besoins linguistiques fluctuants,
                    langue B incontournable, anglais indispensable, etc.).
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class");
            WriteLiteral(@"=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    Cette formation de haut niveau en interprétation permet d'acquérir une parfaite maîtrise des techniques d’interprétation consécutive et simultanée
                    afin d’exercer cette activité dans le cadre de grandes conférences.
                </p>


                <h3 class=""small_heading""> II.3. Approche du programme </h3>
                <p class=""description""> 
                    La première année (M1) Interprétation de conférences est essentiellement consacrée à l’acquisition des techniques d’interprétation (exercices
                    préparatoires, interprétation consécutive et techniques de prise de notes, traduction à vue, interprétation de liaison) à partir de supports variés
                    dans des domaines divers.
                    Elle permet également de mieux connaître la profession d’interprète.
                    En M2, l’on se prépare directement à l’exercice d");
            WriteLiteral(@"e la profession. Les cours sont consacrés à l’apprentissage et au renforcement des différentes
                    techniques utilisées dans la profession. Des stages et des cabines muettes permettent de concrétiser les enseignements sur le terrain. Des
                    séminaires sur les réalités professionnelles et des conférences simulées sont organisés dans une salle entièrement équipée aux normes en matière
                    d’interprétation de conférence.
                </p>

            </div>

        </figure>

